        //[UserComboBoxCode_fft_size_selector] -- add your combo box handling code here..
		fft_size = fft_size_selector->getText().getIntValue();
		sliderValueChanged(fft_overlap_slider);
        //[/UserComboBoxCode_fft_size_selector]
